import React, { useState } from "react";
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  Button,
  TouchableHighlight,
  Keyboard,
  TouchableWithoutFeedback,
  KeyboardAvoidingView,
  AsyncStorage,
} from "react-native";
import { primaryColors, fonts } from "../models/Styles.js";

const PageLink = ({ link }) => {
  return (
    <View style={styles.container}>
      <TouchableHighlight onPress={() => navigation.navigate(link)}>
        <View>
          <View style={styles.tab}></View>
          <Text style={styles.tabText}>{link}</Text>
        </View>
      </TouchableHighlight>
    </View>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, alignItems: "center", marginTop: 2, borderWidth: 1 },
  tab: {
    backgroundColor:
      1 + 1 == 3 ? primaryColors.islandyellow : primaryColors.islandgreen,
    height: 50,
    width: 50,
    borderRadius: 20,
  },
  tabText: {
    fontFamily: "acnh",
    color: primaryColors.darkgreen,
    alignSelf: "center",
  },
});

export default PageLink;
